import React from 'react';
import Toolbar from './Toolbar';
import logo from './logo.svg';
import './App.css';

function Home() {

    const QUESTION_URL = "file:///C:/Users/Zacha/Desktop/opencode/frontend/question.html"
    var i

    return(
        <>
            <Toolbar />

            <div>
                {getAllQuestionNames()}
            </div>

            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <p>
                    Edit <code>src/App.js</code> and save to reload.
                    </p>
                    <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    Learn React
                    </a>
                </header>
            </div>
        </>
    )

    function getAllQuestionNames() {
        let listOfQuestions = document.createElement('ul')

        fetch("http://localhost:8080/api/v1/question")
          .then(response => response.json().then(function(json) {
            for(i = 0; i < json.length; i++) {
              let li = document.createElement('li')
              listOfQuestions.appendChild(li)
              li.innerHTML += "<a href=" + QUESTION_URL + "?name=" + json[i].name + ">" + json[i].name + "</a>"
            }
            console.log(listOfQuestions)
          }))
          return <ul><li>Taco</li></ul>
    }
}

export default Home;
